import * as React from 'react';
import TextField from '@mui/material/TextField';
import { makeStyles } from "@material-ui/core/styles";


function App() {
  const useStyles = makeStyles({
    input: {
      color: "blue"
    }
  });

  const classes = useStyles();

  return (
    <center id="App">
      <h1 className="blue">HAVE YOU SEEN THIS PERSON???</h1>
      <center id="content">
        <img src="https://static.remove.bg/remove-bg-web/3a4699427405e2861e1fd6aabd6280baee37b558/assets/start_remove-c851bdf8d3127a24e2d137a55b1b427378cd17385b01aec6e59d5d4b5f39d2ec.png" alt="randomPerson" width="200" height="200"/>
        <form>
          <div className="input"><TextField className="input" label="First Name" inputProps={{ className: classes.input }} focused /></div>
          <div className="input"><TextField className="input" label="Last Name" inputProps={{ className: classes.input }} focused /></div>
          <div className="input"><TextField className="input" label="Occupation" inputProps={{ className: classes.input }} focused /></div>
        </form>
      </center>
      <p>
        <h3>Greetings!</h3>
        This is a silly little webpage that I made to collect data for another project. 
        I need a large database of named images and so I felt it would be fun to outsouce 
        that using  <a className="blue" href="https://this-person-does-not-exist.com/en">this-person-doesnt-exist.com</a> api to collect that data.
        If you wouldn't mind filling out the form above a few times that would make my day :)
      </p>
    </center>
  );
}

export default App;
